    return(
        <div>
            <p>Nombre:{name}</p>
            <p>Image:<img src={image.url} alt={name} /></p>
            <p>Temperamento:{temperament}</p>
            <p>Peso:{weight.metric} kg</p>
        </div>
    ) 
}

export default Card
